import axios from 'axios'

export const ticket = newTicket => {
  return axios
    .post('users/register', {
      first_name: newTicket.first_name,
      last_name: newTicket.last_name,
      email: newTicket.email,
      password: newTicket.password
    })
    .then(response => {
      console.log('New ticket success')
    })
}

